import React from "react";
import SetupNav from "./SetupNav";
import Poster from "./Poster";

const Setup = () => {
  return (
    <div style={{marginLeft:"50px",marginRight:"50px" }}>
      <SetupNav />
      <Poster/>
    </div>
  );
};

export default Setup;
